import React, { useEffect, useState } from 'react';
import './styles.css';

const FormContainer = ({ documentData, onGenerate }) => {
  const [formInfo, setFormInfo] = useState(documentData);
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState(null);

  useEffect(() => {
    setFormInfo(documentData);
  }, [documentData]);

  const renderFormFields = (fields) => {
    return fields.map(field => (
      <div key={field.id}>
        <label>{field.input_label}</label>
        <input 
          type={field.type} 
          name={field.input_name} 
          defaultValue={field.value} 
          required={field.required} 
        />
      </div>
    ));
  };

  const handleGenerateClick = () => {
    // Call onGenerate with the necessary data
    onGenerate(formInfo);
  };

  if (isLoading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div>Error: {error}</div>;
  }

  return (
    <div className="form-container">
      {formInfo && (
        <>
          <h2>{formInfo.name}</h2>
          {formInfo.steps && formInfo.steps.map(step => (
            <div key={step.id}>
              <h3>{step.name}</h3>
              {renderFormFields(step.fields)}
            </div>
          ))}
          <button onClick={handleGenerateClick}>Generate</button>
        </>
      )}
    </div>
  );
};

export default FormContainer;
